import React, {Component} from 'react'


function Contactus() {
    return (
         <section className="my-5 py-5">       {/* //margin top+bottom and top + bottom padding */}
                <div className="container">
                    <div className="well well-sm">
                        <h3><strong>Our Location</strong></h3>
                    </div>
                </div>
                {/* row for our map and right side form */}
            <div className="row">
                <div className="col-md-7">
                    <iframe src="https://www.google.com/maps/d/u/0/embed?mid=133GRqchpq518-hgJzuwB8IEmhaBr3xBo" width="640" height="480"></iframe>
                </div>
            </div>
        </section>
    )
}
export default Contactus;
